  [],\n\t\"num_tags\": 0,\n\t\"name\": \"biological-assessment-of-marine-resources-for-the-republic-of-the-maldives-indian-ocean-august-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In August 2001, biologists from the U.S.
  Fish and Wildlife Service and the National Marine Fisheries Service were asked to
  conduct an assessment of the national government's capability to respond to major
  threats (e.g. anthropogenic and natural) to the marine habitat of the Republic of
  the Maldives. A marine survey was conducted at selected locations to assess impacts
  to the marine environment. Biologists documented reef fishes, corals, other macroinvertebrates,
  and algae, and provided general descriptions of the benthic community at each of
  four primary survey sites.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
